import { Link } from "react-router-dom";

export default function NotAuthorized() {
  return (
    <div className="container m-5">
      <h1>
        You are not authorized to view this page.
      </h1>
      <h4>
        <Link to="/">
          Take me back home
        </Link>
      </h4>
    </div>
  );
}
